/// Notification detail page (keeps functionality unchanged)
class NotificationDetailScreen extends StatefulWidget {
  final String token;
  final ApiService api;
  final Map<String, dynamic> userNotification;

  const NotificationDetailScreen({
    Key? key,
    required this.token,
    required this.api,
    required this.userNotification,
  }) : super(key: key);

  @override
  _NotificationDetailScreenState createState() =>
      _NotificationDetailScreenState();
}

class _NotificationDetailScreenState extends State<NotificationDetailScreen> {
  late Map<String, dynamic> _un;
  bool _busy = false;

  @override
  void initState() {
    super.initState();
    _un = Map<String, dynamic>.from(widget.userNotification);
  }

  Future<void> _toggleRead() async {
    setState(() {
      _busy = true;
    });
    try {
      if (_un['read'] == true) {
        final updated = await widget.api.markClientNotificationUnread(
            token: widget.token, userNotificationId: _un['id'] as int);
        setState(() {
          _un = Map<String, dynamic>.from(updated);
        });
      } else {
        final updated = await widget.api.markClientNotificationRead(
            token: widget.token, userNotificationId: _un['id'] as int);
        setState(() {
          _un = Map<String, dynamic>.from(updated);
        });
      }
      // return the updated object back to caller
      Navigator.of(context).pop(_un);
    } catch (e) {
      if (mounted)
        ScaffoldMessenger.of(context).showSnackBar(
            const SnackBar(content: Text('Failed to update status')));
    } finally {
      if (mounted)
        setState(() {
          _busy = false;
        });
    }
  }

  @override
  Widget build(BuildContext context) {
    final notif = (_un['notification'] ?? {}) as Map<String, dynamic>;
    final title = notif['title']?.toString() ?? 'Notification';
    final message = notif['message']?.toString() ?? '';
    final created =
        _un['created_at']?.toString() ?? notif['created_at']?.toString();

    return Scaffold(
      appBar: AppBar(
        title: const Text('Notification'),
        actions: [
          IconButton(
            icon: Icon(_un['read'] == true
                ? Icons.mark_email_unread
                : Icons.check_circle_outline),
            tooltip: _un['read'] == true ? 'Mark unread' : 'Mark read',
            onPressed: _busy ? null : _toggleRead,
          )
        ],
      ),
      body: SafeArea(
        child: LayoutBuilder(builder: (context, constraints) {
          final isWide = constraints.maxWidth > 600;
          final maxWidth = isWide ? 720.0 : double.infinity;
          return SingleChildScrollView(
            padding: const EdgeInsets.symmetric(horizontal: 16, vertical: 16),
            child: Center(
              child: ConstrainedBox(
                constraints: BoxConstraints(maxWidth: maxWidth),
                child: Column(
                  crossAxisAlignment: CrossAxisAlignment.stretch,
                  children: [
                    // Header card
                    Container(
                      decoration: BoxDecoration(
                        color: Colors.white,
                        borderRadius: BorderRadius.circular(16),
                        boxShadow: [
                          BoxShadow(
                            color: Colors.black.withOpacity(0.04),
                            blurRadius: 12,
                            offset: const Offset(0, 6),
                          ),
                        ],
                      ),
                      padding: const EdgeInsets.all(16),
                      child: Row(
                        crossAxisAlignment: CrossAxisAlignment.start,
                        children: [
                          Container(
                            width: 44,
                            height: 44,
                            decoration: BoxDecoration(
                              color: Theme.of(context)
                                  .colorScheme
                                  .primary
                                  .withOpacity(0.1),
                              borderRadius: BorderRadius.circular(12),
                            ),
                            child: Icon(Icons.notifications_active_rounded,
                                color: Theme.of(context).colorScheme.primary),
                          ),
                          const SizedBox(width: 12),
                          Expanded(
                            child: Column(
                              crossAxisAlignment: CrossAxisAlignment.start,
                              children: [
                                Text(
                                  title,
                                  style: const TextStyle(
                                    fontSize: 18,
                                    fontWeight: FontWeight.w800,
                                    letterSpacing: -0.2,
                                  ),
                                ),
                                const SizedBox(height: 6),
                                Row(
                                  children: [
                                    Icon(Icons.access_time_rounded,
                                        size: 14, color: Colors.grey.shade500),
                                    const SizedBox(width: 6),
                                    Text(
                                      created != null && created.isNotEmpty
                                          ? DateFormat('MMMM d, yyyy  h:mm a')
                                              .format(DateTime.parse(created)
                                                  .toLocal())
                                          : '',
                                      style: TextStyle(
                                        color: Colors.grey.shade600,
                                        fontSize: 12,
                                      ),
                                    ),
                                  ],
                                ),
                              ],
                            ),
                          ),
                          const SizedBox(width: 8),
                          Chip(
                            label: Text(_un['read'] == true ? 'Read' : 'Unread',
                                style: const TextStyle(color: Colors.white)),
                            backgroundColor:
                                _un['read'] == true ? Colors.green : Colors.red,
                          ),
                        ],
                      ),
                    ),

                    const SizedBox(height: 12),

                    // Message card with HTML rendering
                    Container(
                      decoration: BoxDecoration(
                        color: Colors.white,
                        borderRadius: BorderRadius.circular(16),
                        boxShadow: [
                          BoxShadow(
                            color: Colors.black.withOpacity(0.04),
                            blurRadius: 12,
                            offset: const Offset(0, 6),
                          ),
                        ],
                      ),
                      padding: const EdgeInsets.fromLTRB(16, 14, 16, 16),
                      child: _buildHtmlMessage(message),
                    ),

                    if (notif.containsKey('data') && notif['data'] != null)
                      Padding(
                        padding: const EdgeInsets.only(top: 12),
                        child: Card(
                          margin: EdgeInsets.zero,
                          shape: RoundedRectangleBorder(
                              borderRadius: BorderRadius.circular(12)),
                          child: ListTile(
                            leading: const Icon(Icons.link),
                            title: const Text('Open linked content'),
                            subtitle: Text(notif['data'].toString()),
                            onTap: () {
                              ScaffoldMessenger.of(context).showSnackBar(
                                const SnackBar(
                                  content: Text(
                                      'Deep link tapped (implement navigation)'),
                                ),
                              );
                            },
                          ),
                        ),
                      ),

                    const SizedBox(height: 16),

                    // Actions
                    Row(
                      children: [
                        Expanded(
                          child: ElevatedButton.icon(
                            onPressed: _busy ? null : _toggleRead,
                            icon: Icon(_un['read'] == true
                                ? Icons.mark_email_unread
                                : Icons.check_circle_outline),
                            label: Text(_un['read'] == true
                                ? 'Mark Unread'
                                : 'Mark Read'),
                            style: ElevatedButton.styleFrom(
                              padding: const EdgeInsets.symmetric(vertical: 14),
                              shape: RoundedRectangleBorder(
                                borderRadius: BorderRadius.circular(10),
                              ),
                            ),
                          ),
                        ),
                      ],
                    ),
                  ],
                ),
              ),
            ),
          );
        }),
      ),
    );
  }

  /// Renders HTML message nicely with responsive styles and safe defaults.
  Widget _buildHtmlMessage(String html) {
    // Fallback if message isn't HTML-like
    final looksLikeHtml = html.contains('<') && html.contains('>');
    if (!looksLikeHtml) {
      return Text(
        html,
        style: const TextStyle(fontSize: 15, height: 1.5),
      );
    }

    try {
      // Import flutter_html at top of file if needed
      // ignore: unused_local_variable
      return _HtmlRenderer(html: html);
    } catch (_) {
      // In case the package is not available at runtime yet
      return Text(
        html,
        style: const TextStyle(fontSize: 15, height: 1.5),
      );
    }
  }
}

